        foreach ($sites as $s ) {
            if(!empty($s)){

                $region_bam = Str::lower($s["region_bam"]);
                $region_postale = Str::lower($s["region_postale"]);
                
                $rb = RegionBam::where("nom",$region_bam)->first();
                $rp = RegionPostale::where("nom", $region_postale)->first();

                $site = new Site();
                $site->code = $s["code"];
                $site->code_patrimoine = $s["code_patrimoine"];
                $site->n_convention = $s["n_convention"];
                $site->denomination = $s["denomination"];
                $site->adresse = $s["adresse"];
                $site->superficie = $s["superficie"];
                $site->type_detention = $s["type_detention"];

                if(!empty($rb)){
                    $site->region_bam()->associate($rb);
                } else if(!empty($region_bam)){
                    $new_rb = RegionBam::create(["nom"=>$region_bam]);
                    $site->region_bam()->associate($new_rb);
                }

                
                if(!empty($rp)){
                    $site->region_postale()->associate($rp);
                } else if(!empty($region_postale)){
                    $new_rp = RegionPostale::create(["nom"=>$region_postale]);
                    $site->region_postale()->associate($new_rp);
                }

                $site->save();

            }
        }
